【送料無料】<br><!-- 商品説明 ここから --><div class=cartRap><h3>商品説明</h3><p>★ 52万画素CCD搭載の高解像度700TVLモデルです。録画方式H.264を採用し、高画質・長時間録画を実現しました。<br /><br />★ 2.8～12mmのバリフォーカルレンズで広範囲の撮影が可能です。また、赤外線投光器内蔵ですので、夜間の撮影が可能です(最長照射距離約15m、赤外線照射時は白黒撮影)。<br /><br />★ 赤外線照射による乱反射を被写体に合わせて調整するスマートIR機能を搭載しました。また、2D-DNR(デジタルノイズリダクション)機能により低照度撮影時のノイズを低減します。<br /><br />★ カメラID表示機能により、画面上に最大2列52文字のカメラタイトルの表示が可能です。<br /><br />★ プライバシーゾーン機能により、画面上の任意の領域を最大8ヶ所まで見えなくすることができます。<br /><br />★ SDカードレコーダーを内蔵しているので、監視と録画が1台のみで行えます。<br /><br />★ 動作検知録画機能(録画ファイル数上限90112まで)、自動上書録画機能を搭載しました。<br /><br />★ 録画データの再生を制限するパスワード機能付きです。<br /><br />★ 各機能の設定は、モニター画面上にメニューが表示され、リモコンにて設定ができます。<br /><br />★ 別売りのブラケットを使用して壁面への設置も可能です。</p></div><!-- 商品説明 ここまで --><!-- 商品仕様 ここから --><div class=cartRap><h3>スペック</h3><p>* イメージセンサー:1/3インチカラーCCD 52万画素 SONY製　<br />* 有効画素:H976×V494　<br />* レンズ(mm):2.8～12　<br />* 水平視野角(°):約81～23　<br />* 走査方式:2:1インターレース　<br />* 水平解像度:700TVライン　<br />* 逆光補正:BLC/HLC　<br />* ダイナミックレンジ:ATR(D-WDR)　<br />* 同期方式:内部同期　<br />* ビデオ信号出力:1.0Vp-p 75Ω　<br />* ガンマ補正:0.45　<br />* 映像出力端子:BNC.J　<br />* 被写体最低照度(Lux):0.5(F1.2)　<br />* SN比(dB):48(AGC OFF)　<br />* デイナイト機能:自動/カラー/BW　<br />* オートゲインコントロール:ON/OFF　<br />* ホワイトバランス:ATW/PUSH/ユーザー1/ユーザー2/ANTI CR/手動/PUSH LOCK　<br />* シャッタースピード(秒):1/60～1/100000　<br />* ノイズリダクション:2D-DNR　<br />* プライバシーマスク:8ヶ所任意設置　<br />* 画質調整:左右反転/ブライトネス/コントラスト/シャープネス/色相/ゲイン　<br />* 赤外線照射距離(m):最長約15(LED21個/850nm)　<br />* 録画方式:H.264　<br />* 録画解像度:960×480/720×480/320×240　<br />* 録画速度(fps):1/2/4/10/15/20/30</p></div><!-- 商品仕様 ここまで --><style>

